import React from 'react';
import './index.css';

function NAVBAR__LOGIC() {
  const [show, setShow] = React.useState(false);


  return (
  <div className='items-center justify-end right-5 flex md:center'>
    <nav className=''>
      <button className='translate-y-1 top-2 mr-5 md:hidden ' id="hamburger" onClick={()=>setShow(!show)}>
        <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
        <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
        <div className='bg-white w-7 h-1 rounded-md'></div>
      </button>
      {show?<div className=' bg-gray-800 bg-opacity-10 w-full right-0 mt-2 border-1 border-black absolute justify-center items-center justify-items-center flex' id="nav-ul">
        <ul className='w-32'>
        <li className='mt-2'>
        <div className='justify-center items-center justify-items-center flex text-xl bg-transparent'><a href="/">About Me</a></div>
        </li>
        <li className='mt-5'>
        <div className='justify-center items-center justify-items-center flex text-xl bg-transparent'><a href="/">Projects</a></div>
        </li>
        <li className='mt-5 mb-2'>
        <div className='justify-center items-center justify-items-center flex text-xl bg-transparent'><a href="/">Contact</a></div> 
        </li>
      </ul>
      </div>:null}
      <div className='sm:hidden'>
        <ul className=''>
        <li className='inline-flex'>
        <div className=''><a href="/">About Me</a></div>
        </li>
        <li className='inline-flex'>
        <div className=''><a href="/">Projects</a></div>
        </li>
        <li className='inline-flex'>
        <div className=''><a href="/">Contact</a></div> 
        </li>
      </ul>
      </div>
    </nav>
  </div>);
}

class NAVBAR extends React.Component {
  render() {
    return (
      <header>
        <div className='bg-orange-500 fixed w-full h-11 md:h-14 items-center grid grid-cols-2 md:grid-cols-3'>
          <div className='flex justify-center text-xl text-gray-600 italic decoration-2'><a className='bg-white-500' href="/">Home</a></div>
          <NAVBAR__LOGIC />
        </div> 
      </header>
    );
  }
}

function App() {
  return (
    <div className="App">
      <NAVBAR />
    </div>
  );
}

export default App;
